import React from 'react';
// Components
import MovieList from "./components/MovieList";
import 'normalize.css';
import './App.scss';

const App = () => {
  const api_key = process.env.API_KEY

const data = fetch(`https://api.themoviedb.org/3/discover/movie?api_key=${api_key}&language=en-US&sort_by=popularity.desc&include_adult=false&include_video=false&page=1`).then((response) => (response.json()))

  return (
    <div className="App">
      <h1>React Study Group Movie - Database</h1>
      <MovieList data={data} />
    </div>
  );
}

export default App;
